const App = () => {

    const [count, setCount] = useState(0);



    const [time,setTime] = useState(newTime);

    const IncNum = () => {
        setCount(count + 1);
        console.log("clicked")
    }
    const IncTime = () => {
        let newTime = new Date().toLocaleTimeString();
        console.log(newTime);
        setTime(newTime);
        console.log("clicked")
    }

    return (
        <>
            <div className="body">
                <h1>{count}</h1>
                <button className="buttonA" onClick={IncNum}>Click Me</button>

                <h2>{time}</h2>
                <button className="buttonB" onClick={IncTime}> Get Time</button>

            </div>

        </>
    );

};

export default App;
